L'ottone è una lega ossidabile formata da rame (Cu) e zinco (Zn), simile all'oricalco. Bisogna distinguere tra ottoni ternari, costituiti da rame e zinco, e ottoni quaternari, in cui è presente un quarto elemento chimico caratterizzante la lega o altri ottoni binari in cui sono presenti altri elementi chimici. Considerando gli ottoni ternari, si parla di fase α quando il contenuto di zinco è inferiore al 36% circa; la struttura cristallina della lega ricalca quella del rame, cioè quella cubica a facce centrate. Questi ottoni hanno eccellente lavorabilità a freddo (imbutitura e stampaggio) e buona a freddo. Gli ottoni α-β (dove la fase β è struttura cubica a corpo centrato) hanno un titolo di zinco oscillante tra il 36 e il 45%; sono facilmente lavorabili a caldo. Le leghe con percentuali di Zn superiori al 45% non hanno interesse pratico. La lavorabilità alle macchine utensili delle leghe binarie rame-zinco è buona, ma la tenacità provoca la formazione di trucioli molto lunghi; per ovviare a tale inconveniente viene aggiunto del piombo (Pb) che, insolubile ed estraneo alla struttura cristallina, si disperde ai bordi dei grani: così i trucioli diventano corti o addirittura polverosi e gli utensili subiscono un'usura e un riscaldamento minori, con conseguente miglioramento della qualità e della velocità della lavorazione. Gli ottoni al piombo sono denominati anche ottoni secchi. Alla lega possono essere aggiunti altri elementi per ottenere determinate proprietà: 
* il manganese e lo stagno aumentano la resistenza alla corrosione; 
* il ferro aumenta il carico di rottura; 
* l'alluminio aumenta la resistenza alla corrosione e all'abrasione; 
* l'antimonio e l'arsenico inibiscono la dezincificazione. 
* il nichel migliora le caratteristiche meccaniche e la resistenza alla corrosione; 
* il silicio serve a disossidare e favorisce la creazione della fase β. L'influenza degli elementi in lega può essere studiata attraverso i coefficienti di Guillet: cioè l'aggiunta di un terzo elemento in lega può essere considerata equivalente alla aggiunta o sottrazione di zinco. Per esempio, l'aggiunta di silicio (coeff. =10) equivale ad una quantità di zinco 10 volte maggiore: accade così che se ad un ottone binario Cu Zn 30 (a totale struttura α) viene aggiunto 1-2% di silicio, diventa a struttura totalmente β. Il nichel ha un coefficiente di equivalenza negativo, mentre quello del piombo è nullo, dal momento che, disponendosi ai bordi dei grani, non entra nel reticolo cristallino.
